        <notes>Specifies through respective annotations within this annotation the resources and values of the triple statements that i) must be generated by the application and added to the underlying RDF file when the user specifies a value/resource input for the respective MDB entry component or ii) must be deleted from that file, if the user/GUI input is 'false' or empty. %nl;%nl;This execution step is used when a predefined triple statement (including variables that are user-input) must be generated and added to a particular named graph through interacting with this MDB entry component. %nl;In case the user-input is 'true' (=e.g. clicked button), a string value or a selected resource, the exectution step is in 'save' modus and the respective triple statement(s) must be added. %nl;If, however, the user-input is 'false' (= e.g. unchecked check-box) or the string is empty or no resource is selected for the input, the execution step is in the 'delete' modus and the respective triple statement(s) must be deleted.%nl;If no input can be associated with this annotation, 'save' is being assumed as the default modus and the 'delete triple statement (BOOLEAN)' annotation can be used to indicate that the 'delete' modus must be used.%nl;%nl;%nl;%nl;Like any other 'execution step' annotation, the string part is used for providing a number, occassionally accompanied by a character. The number and character indicate in which sequence the information should be processed: from small to large, from A to Z. All annotations with the same number belong together. The numbers are also used for indicating alternative input (see 'alternative to triple statement(s)' annotation).</notes>
